<?php die(); ?>#(^-^)#{"__meta":{"id":"X64083ea7991ff00ecff40c276edf043b","datetime":"2022-07-03 11:15:18","utime":1656846918.0386040210723876953125,"method":"POST","uri":"\/administrator\/index.php?option=com_content&layout=edit&id=2","ip":"::1"},"info":{"phpVersion":"8.1.0","joomlaVersion":"4.1.3","requestId":"X64083ea7991ff00ecff40c276edf043b","identity":{"type":"user","id":330,"name":"Kevin Lehmann","username":"ShinyKampfkeule"},"response":{"status_code":200},"template":{"template":"atum","home":"","id":""},"database":{"dbserver":"mysql","dbversion":"5.7.25-28","dbcollation":"utf8_general_ci","dbconnectioncollation":"utf8mb4_general_ci","dbconnectionencryption":"","dbconnencryptsupported":true}},"memory":{"peak_usage":21620544,"peak_usage_str":"21MB"},"request":{"$_GET":"array:3 [\n  \"option\" => \"com_content\"\n  \"layout\" => \"edit\"\n  \"id\" => \"2\"\n]","$_POST":"array:13 [\n  \"jform\" => array:30 [\n    \"title\" => \"Drei Wochen \"Gegen das Vergessen\" - ein Resum\u00e9e\"\n    \"alias\" => \"drei-wochen-gegen-das-vergessen-ein-resumee\"\n    \"articletext\" => \"\"\n    \"transition\" => \"\"\n    \"state\" => \"1\"\n    \"catid\" => \"8\"\n    \"featured\" => \"1\"\n    \"access\" => \"1\"\n    \"language\" => \"*\"\n    \"note\" => \"\"\n    \"version_note\" => \"\"\n    \"images\" => array:8 [\n      \"image_intro\" => \"\"\n      \"image_intro_alt\" => \"\"\n      \"float_intro\" => \"\"\n      \"image_intro_caption\" => \"\"\n      \"image_fulltext\" => \"\"\n      \"image_fulltext_alt\" => \"\"\n      \"float_fulltext\" => \"\"\n      \"image_fulltext_caption\" => \"\"\n    ]\n    \"urls\" => array:9 [\n      \"urla\" => \"\"\n      \"urlatext\" => \"\"\n      \"targeta\" => \"\"\n      \"urlb\" => \"\"\n      \"urlbtext\" => \"\"\n      \"targetb\" => \"\"\n      \"urlc\" => \"\"\n      \"urlctext\" => \"\"\n      \"targetc\" => \"\"\n    ]\n    \"attribs\" => array:26 [\n      \"article_layout\" => \"\"\n      \"show_title\" => \"\"\n      \"link_titles\" => \"\"\n      \"show_tags\" => \"\"\n      \"show_intro\" => \"\"\n      \"info_block_position\" => \"\"\n      \"info_block_show_title\" => \"\"\n      \"show_category\" => \"\"\n      \"link_category\" => \"\"\n      \"show_parent_category\" => \"\"\n      \"link_parent_category\" => \"\"\n      \"show_author\" => \"\"\n      \"link_author\" => \"\"\n      \"show_create_date\" => \"\"\n      \"show_modify_date\" => \"\"\n      \"show_publish_date\" => \"\"\n      \"show_item_navigation\" => \"\"\n      \"show_hits\" => \"\"\n      \"show_noauth\" => \"\"\n      \"urls_position\" => \"\"\n      \"alternative_readmore\" => \"\"\n      \"article_page_title\" => \"\"\n      \"show_publishing_options\" => \"\"\n      \"show_article_options\" => \"\"\n      \"show_urls_images_backend\" => \"\"\n      \"show_urls_images_frontend\" => \"\"\n    ]\n    \"com_fields\" => array:5 [\n      \"volltext\" => \"\"\"\n        Eine Ausstellung mit \u00fcbergro\u00dfen Portraits von \u00dcberlebenden des Holocaust.\\r\\n\n        Eine Ausstellung, die den rassistischen Gr\u00e4ueltaten Nazi-Deutschlands viele Gesichter verleiht.\\r\\n\n        Eine Ausstellung, die das zu gern Vergessene wieder in den Vordergrund schiebt.\\r\\n\n        \\r\\n\n        Ab Mitte Januar 2022 konnten wir dann drei Wochen lang 26 ausgew\u00e4hlte Portraits in einer Ausstellung zeigen. Freiwillige Sch\u00fcler-Scouts f\u00fchrten die angemeldeten Gruppen durch die Ausstellung. Insgesamt haben mehr als 700 Menschen die Ausstellung bei uns gesehen.\\r\\n\n        \\r\\n\n        In der Auftaktveranstaltung er\u00f6ffneten Gesch\u00e4ftsf\u00fchrer Sascha Lohwa\u00dfer und Schulleiter Ulf Kager die Ausstellung mit eindr\u00fccklichen Ansprachen und Hinweisen auf das vielseitige Rahmenprogramm. Dazu z\u00e4hlte u.a. eine Podiumsdiskussion zum Thema \u201eDemokratie braucht Erinnerungskultur\u201c mit dem Fachreferenten des Referats f\u00fcr Gedenkst\u00e4ttenarbeit in Baden-W\u00fcrttemberg, Andreas Schulz, und unter der Moderation zweier Teilnehmer unserer Schule.\\r\\n\n        \\r\\n\n        Des Weiteren erm\u00f6glichte eine live-online-Schaltung nach Jerusalem den Azubis unserer Schule, mit dem Fotografen Luigi Toscano selbst zu sprechen und ihm Fragen zu stellen. Herr Toscano war kurzfristig anl\u00e4sslich des internationalen Tages des Gedenkens an die Opfer des Holocaust am 27.1.22 nach Jerusalem eingeladen worden, sonst w\u00e4re er zu uns in die Aula gekommen.\\r\\n\n        \\r\\n\n        Umfangreiches Material zu Themen wie Holocaust, Rassismus und Menschenrechte stand auf der Lern-Plattform \u201eMoodle\u201c bereit. Erarbeitet wurde es gr\u00f6\u00dftenteils von der Landeszentrale f\u00fcr politische Bildung Baden-W\u00fcrttemberg, eigens konzipiert als Begleitmaterial zu der Ausstellung \u201eGegen das Vergessen\u201c.\\r\\n\n        \\r\\n\n        Eine Gruppe von Azubis der Medienwerkstatt erstellte einen Film-Trailer sowie einen kurzen .\\r\\n\n        \\r\\n\n        Drei Tage vor Ausstellungsende brachte die Theatergruppe lokstoff! den Zuschauern die Ausstellung noch auf eine besonders intensive Weise nahe. In unserer Aula hatten \u2013 coronabedingt \u2013 80 Zuschauer Platz. Jeder war mit einem Kopfh\u00f6rer ausgestattet, \u00fcber den das Publikum dem St\u00fcck folgen konnte. Es erz\u00e4hlt die Lebens- und Leidensgeschichte von zwei Frauen, deren Portraits aus der Ausstellung herausgeholt und auf die B\u00fchne gebracht wurden.\\r\\n\n        \\r\\n\n        Besonders beeindruckend ist die Intensit\u00e4t, mit der der Zuschauer diesen zwei Leben folgen kann: Der Altersunterschied zwischen den jungen Laiendarstellerinnen, die das Leben der portraitierten alten Frauen erz\u00e4hlen, macht einmal mehr deutlich, welche schlimmen Erlebnisse diese Leben pr\u00e4gten \u2013 und was den j\u00fcngeren Menschen\/Zuschauern bisher erspart geblieben ist.\\r\\n\n        \\r\\n\n        Bemerkenswert ist das Engagement der Theatergruppe, handelt sich doch um Laiendarsteller. Sch\u00fclerinnen und Studentinnen haben in ihrer Freizeit geprobt und m\u00fcssen f\u00fcr jede Vorstellung von der Schule (oder Uni) freigestellt werden. Das verdient gro\u00dfen Respekt.\\r\\n\n        \\r\\n\n        Am 6. Februar 22 traten die Portraits die Reise zum n\u00e4chsten Ausstellungsort an. Geblieben sind unseren Sch\u00fclern eindr\u00fcckliche Erinnerungen, die ganz sicher lange Zeit gegen das Vergessen wirken.\\r\\n\n        \\r\\n\n        Ein Bericht der UNESCO-Projektschule am SRH Berufsbildungswerk Neckargem\u00fcnd\n        \"\"\"\n      \"teaser-area\" => \"Die Berufsschule am Berufsbildungswerk Neckargem\u00fcnd ist seit dem Jahr 2010 anerkannte UNESCO-Projektschule. Als wir zum ersten Mal von der Ausstellung \u201eGegen das Vergessen\u201c des Mannheimer Fotografen Luigi Toscano h\u00f6rten, war uns klar, dass wir diese Ausstellung unbedingt an unsere Schule holen m\u00f6chten: Eine Ausstellung, die schon an vielen Orten dieser Erde zu sehen war: in den USA, Ukraine, Frankreich, \u00d6sterreich, der Schweiz und an vielen Orten in Deutschland.\"\n      \"hauptbild\" => \"{\"key\":\"plg_fields_econa_62b072abcbfa7\",\"itemId\":\"2\",\"context\":\"com_content.article\",\"filename\":\"remember-holocaust-2020\",\"ratios\":[{\"label\":\"2\/1\",\"value\":2}],\"free_ratio\":\"0\",\"params\":{\"sizes\":{\"sizes0\":{\"label\":\"Small\",\"identifier\":\"S\",\"width\":\"400\",\"quality\":\"100\"},\"sizes1\":{\"label\":\"Medium\",\"identifier\":\"M\",\"width\":\"600\",\"quality\":\"100\"},\"sizes2\":{\"label\":\"Large\",\"identifier\":\"L\",\"width\":\"900\",\"quality\":\"100\"}},\"jpeg\":\"1\",\"webp\":\"1\",\"media\":\"1\",\"css\":\"1\",\"auto_edit\":\"1\",\"aspect_ratios\":{\"aspect_ratios0\":{\"ratio\":\"2\/1\"}},\"free_aspect_ratio\":\"0\",\"og_image\":\"0\",\"display\":{\"display0\":{\"view\":\"archive\",\"image_sizes_attribute\":\"\",\"caption\":\"1\",\"credits\":\"1\",\"link\":\"0\",\"modal\":\"0\"},\"display1\