tr":"2.33KB","caller":"D:\\Kevin Zeugs\\Studium\\CMS\\cms\\libraries\\vendor\\joomla\\database\\src\\Mysqli\\MysqliDriver.php:584","callstack":[],"explain":[],"explain_col":[],"profile":[]},{"sql":"SELECT *\r\nFROM e5oha_fields\r\nWHERE `id` = '2'","params":[],"duration_str":"30.54ms","memory_str":"4.06KB","caller":"D:\\Kevin Zeugs\\Studium\\CMS\\cms\\libraries\\src\\Table\\Table.php:807","callstack":[],"explain":[],"explain_col":[],"profile":[]},{"sql":"SELECT `category_id`\r\nFROM `e5oha_fields_categories`\r\nWHERE `field_id` = :fieldid","params":{":fieldid":{"value":2,"dataType":"int","length":0,"driverOptions":[]}},"duration_str":"32.21ms","memory_str":"1.61KB","caller":"D:\\Kevin Zeugs\\Studium\\CMS\\cms\\administrator\\components\\com_fields\\src\\Model\\FieldModel.php:404","callstack":[],"explain":[],"explain_col":[],"profile":[]},{"sql":"SELECT `field_id`,`value`\r\nFROM `e5oha_fields_values`\r\nWHERE `field_id` IN (:preparedArray1) AND `item_id` = :itemid","params":{":preparedArray1":{"value":2,"dataType":"int","length":0,"driverOptions":[]},":itemid":{"value":"2","dataType":"string","length":0,"driverOptions":[]}},"duration_str":"32.27ms","memory_str":"1.7KB","caller":"D:\\Kevin Zeugs\\Studium\\CMS\\cms\\administrator\\components\\com_fields\\src\\Model\\FieldModel.php:756","callstack":[],"explain":[],"explain_col":[],"profile":[]},{"sql":"SHOW FULL COLUMNS FROM `e5oha_fields_values`","params":[],"duration_str":"42.31ms","memory_str":"1.94KB","caller":"D:\\Kevin Zeugs\\Studium\\CMS\\cms\\administrator\\components\\com_fields\\src\\Model\\FieldModel.php:692","callstack":[],"explain":[],"explain_col":[],"profile":[]},{"sql":"UPDATE `e5oha_fields_values` SET `value`='Eine Ausstellung mit \u00fcbergro\u00dfen Portraits von \u00dcberlebenden des Holocaust.\\r\\nEine Ausstellung, die den rassistischen Gr\u00e4ueltaten Nazi-Deutschlands viele Gesichter verleiht.\\r\\nEine Ausstellung, die das zu gern Vergessene wieder in den Vordergrund schiebt.\\r\\n\\r\\nAb Mitte Januar 2022 konnten wir dann drei Wochen lang 26 ausgew\u00e4hlte Portraits in einer Ausstellung zeigen. Freiwillige Sch\u00fcler-Scouts f\u00fchrten die angemeldeten Gruppen durch die Ausstellung. Insgesamt haben mehr als 700 Menschen die Ausstellung bei uns gesehen.\\r\\n\\r\\nIn der Auftaktveranstaltung er\u00f6ffneten Gesch\u00e4ftsf\u00fchrer Sascha Lohwa\u00dfer und Schulleiter Ulf Kager die Ausstellung mit eindr\u00fccklichen Ansprachen und Hinweisen auf das vielseitige Rahmenprogramm. Dazu z\u00e4hlte u.a. eine Podiumsdiskussion zum Thema \u201eDemokratie braucht Erinnerungskultur\u201c mit dem Fachreferenten des Referats f\u00fcr Gedenkst\u00e4ttenarbeit in Baden-W\u00fcrttemberg, Andreas Schulz, und unter der Moderation zweier Teilnehmer unserer Schule.\\r\\n\\r\\nDes Weiteren erm\u00f6glichte eine live-online-Schaltung nach Jerusalem den Azubis unserer Schule, mit dem Fotografen Luigi Toscano selbst zu sprechen und ihm Fragen zu stellen. Herr Toscano war kurzfristig anl\u00e4sslich des internationalen Tages des Gedenkens an die Opfer des Holocaust am 27.1.22 nach Jerusalem eingeladen worden, sonst w\u00e4re er zu uns in die Aula gekommen.\\r\\n\\r\\nUmfangreiches Material zu Themen wie Holocaust, Rassismus und Menschenrechte stand auf der Lern-Plattform \u201eMoodle\u201c bereit. Erarbeitet wurde es gr\u00f6\u00dftenteils von der Landeszentrale f\u00fcr politische Bildung Baden-W\u00fcrttemberg, eigens konzipiert als Begleitmaterial zu der Ausstellung \u201eGegen das Vergessen\u201c.\\r\\n\\r\\nEine Gruppe von Azubis der Medienwerkstatt erstellte einen Film-Trailer sowie einen kurzen .\\r\\n\\r\\nDrei Tage vor Ausstellungsende brachte die Theatergruppe lokstoff! den Zuschauern die Ausstellung noch auf eine besonders intensive Weise nahe. In unserer Aula hatten \u2013 coronabedingt \u2013 80 Zuschauer Platz. Jeder war mit einem Kopfh\u00f6rer ausgestattet, \u00fcber den das Publikum dem St\u00fcck folgen konnte. Es erz\u00e4hlt die Lebens- und Leidensgeschichte von zwei Frauen, deren Portraits aus der Ausstellung herausgeholt und auf die B\u00fchne gebracht wurden.\\r\\n\\r\\nBesonders beeindruckend ist die Intensit\u00e4t, mit der der Zuschauer diesen zwei Leben folgen kann: Der Altersunterschied zwischen den jungen Laiendarstellerinnen, die das Leben der portraitierten alten Frauen erz\u00e4hlen, macht einmal mehr deutlich, welche schlimmen Erlebnisse diese Leben pr\u00e4gten \u2013 und was den j\u00fcngeren Menschen\/Zuschauern bisher erspart geblieben ist.\\r\\n\\r\\nBemerkenswert ist das Engagement der Theatergruppe, handelt sich doch um Laiendarsteller. Sch\u00fclerinnen und Studentinnen haben in ihrer Freizeit geprobt und m\u00fcssen f\u00fcr jede Vorstellung von der Schule (oder Uni) freigestellt werden. Das verdient gro\u00dfen Respekt.\\r\\n\\r\\nAm 6. Februar 22 traten die Portraits die Reise zum n\u00e4chsten Ausstellungsort an. Geblieben sind unseren Sch\u00fclern eindr\u00fcckliche Erinnerungen, die ganz sicher lange Zeit gegen das Vergessen wirken.\\r\\n\\r\\nEin Bericht der UNESCO-Projektschule am SRH Berufsbildungswerk Neckargem\u00fcnd' WHERE `field_id` = '2' AND `item_id` = '2'","params":[],"duration_str":"33.89ms","memory_str":"48B","caller":"D:\\Kevin Zeugs\\Studium\\CMS\\cms\\administrator\\components\\com_fields\\src\\Model\\FieldModel.php:692","callstack":[],"explain":[],"explain_col":[],"profile":[]},{"sql":"SELECT *\r\nFROM e5oha_fields\r\nWHERE `id` = '3'","params":[],"duration_str":"30.54ms","memory_str":"4.02KB","caller":"D:\\Kevin Zeugs\\Studium\\CMS\\cms\\libraries\\src\\Table\\Table.php:807","callstack":[],"explain":[],"explain_col":[],"profile":[]},{"sql":"SELECT `category_id`\r\nFROM `e5oha_fields_categories`\r\nWHERE `field_id` = :fieldid","params":{":fieldid":{"value":3,"dataType":"int","length":0,"driverOptions":[]}},"duration_str":"30.39ms","memory_str":"1.61KB","caller":"D:\\Kevin Zeugs\\Studium\\CMS\\cms\\administrator\\components\\com_fields\\src\\Model\\FieldModel.php:404","callstack":[],"explain":[],"explain_col":[],"profile":[]},{"sql":"SELECT `field_id`,`value`\r\nFROM `e5oha_fields_values`\r\nWHERE `field_id` IN (:preparedArray1) AND `item_id` = :itemid","params":{":preparedArray1":{"value":3,"dataType":"int","length":0,"driverOptions":[]},":itemid":{"value":"2","dataType":"string","length":0,"driverOptions":[]}},"duration_str":"38.78ms","memory_str":"1.7KB","caller":"D:\\Kevin Zeugs\\Studium\\CMS\\cms\\administrator\\components\\com_fields\\src\\Model\\FieldModel.php:756","callstack":[],"explain":[],"explain_col":[],"profile":[]},{"sql":"SHOW FULL COLUMNS FROM `e5oha_fields_values`","params":[],"duration_str":"30.48ms","memory_str":"1.94KB","caller":"D:\\Kevin Zeugs\\Studium\\CMS\\cms\\administrator\\components\\com_fields\\src\\Model\\FieldModel.php:692","callstack":[],"explain":[],"explain_col":[],"profile":[]},{"sql":"UPDATE `e5oha_fields_values` SET `value`='Die Berufsschule am Berufsbildungswerk Neckargem\u00fcnd ist seit dem Jahr 2010 anerkannte UNESCO-Projektschule. Als wir zum ersten Mal von der Ausstellung \u201eGegen das Vergessen\u201c des Mannheimer Fotografen Luigi Toscano h\u00f6rten, war uns klar, dass wir diese Ausstellung unbedingt an unsere Schule holen m\u00f6chten: Eine Ausstellung, die schon an vielen Orten dieser Erde zu sehen war: in den USA, Ukraine, Frankreich, \u00d6sterreich, der Schweiz und an vielen Orten in Deutschland.' WHERE `field_id` = '3' AND `item_id` = '2'","params":[],"duration_str":"30.86ms","memory_str":"48B","caller":"D:\\Kevin Zeugs\\Studium\\CMS\\cms\\administrator\\components\\com_fields\\src\\Model\\FieldModel.php:692","callstack":[],"explain":[],"explain_col":[],"profile":[]},{"sql":"SELECT *\r\nFROM e5oha_fields\r\nWHERE `id` = '4'","params":[],"duration_str":"30.75ms","memory_str":"4.02KB","caller":"D:\\Kevin Zeugs\\Studium\\CMS\\cms\\libraries\\src\\Table\\Table.php:807","callstack":[],"explain":[],"explain_col":[],"profile":[]},{"sql":"SELECT `category_id`\r\nFROM `e5oha_fields_c